function getAuthFormHTML(){return`
		<form class='popup__form' action='#'>

			<input type="email" placeholder="Email" class='popup__email popup__input'>
			<input type="password" placeholder="Password" class='popup__password popup__input'>

				<button class="popup__btn btn" type="submit">Войти</button>

		</form>
	`}function getAuthWithEmailAndPassword(t,o){return fetch("https://identitytoolkit.googleapis.com/v1/accounts:signInWithPassword?key=AIzaSyCCPjDXzS-Je3ggL2nuqX8DUq6U0qkpEVc",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({email:t,password:o,returnSecureToken:!0})}).then(t=>t.json()).then(t=>t.idToken)}export{getAuthFormHTML,getAuthWithEmailAndPassword};